import React, { useState, useEffect } from 'react'
import axios from 'axios'
import './match.css'

import { MatchResult, MatchSquad } from '../../components/index'

const MatchDetail = () => {
  const [matchs, setMatchs] = useState(null)

  useEffect(() => {
    getMatchs()
  }, [])

  const getMatchs = async () => {
    console.log(`http://localhost:8000/matchs/${matchs?._id}`)
    const response = await axios.get(`http://localhost:8000/matchs/63791586503f1e53a5a22dbc`)
    setMatchs(response.data)
  }

  return (
    <div className='section__padding'>
      <MatchResult data={matchs}/>
      <MatchSquad data={matchs}/>
    </div>
  )
}

export default MatchDetail
